INSERT INTO `articles` VALUES (70,58,'Pagne Hollantex Trésor du Piroguier - Super Wax Nature',2500.00,'\r\nCe pagne Super Wax déploie un motif emblématique centré sur les jarres (ou calebasses) stylisées, souvent symboles de subsistance, d\'hospitalité et de richesse. Les lignes ondulées qui servent de fond évoquent l\'eau, le fleuve ou le voyage. La palette de couleurs est riche et classique : brun chocolat profond accentué par un ocre jaune éclatant sur un fond crème. C\'est un tissu sophistiqué et intemporel, parfait pour des robes longues, des jupes midi élégantes, ou pour exprimer un style africain chic et authentique.','http://localhost:5000/uploads/1764098663698-IMG-20251125-WA0009.jpg','[\"http://localhost:5000/uploads/1764098663698-IMG-20251125-WA0009.jpg\"]',1,0,NULL,'2025-11-25 19:24:23'),(71,58,'Pagne Hollantex Tissage d\'Étoiles - Géométrie Nuit',2500.00,'\r\nUn tissu à l\'effet optique hypnotisant ! Le Tissage d\'Étoiles est un chef-d\'œuvre de micro-motifs géométriques. Sur un fond noir profond, une grille de petites fleurs ou étoiles est répétée à l\'infini, créant une texture visuelle riche et dense. Les éclats de vert fluorescent et de bleu électrique donnent une dimension vibrante et moderne. Ce pagne est un excellent choix pour les tenues de soirée, les costumes structurés ou les pièces audacieuses qui attirent le regard par leur complexité graphique. Il se marie parfaitement avec des unis pour laisser parler son motif fascinant.','http://localhost:5000/uploads/1764098704744-IMG-20251125-WA0010.jpg','[\"http://localhost:5000/uploads/1764098704744-IMG-20251125-WA0010.jpg\"]',1,0,NULL,'2025-11-25 19:25:04'),(72,58,'Pagne Hollantex Patrimoine Baoulé - Block Print Marron',2500.00,'Ce tissu Super Block Print Hollantex est une ode à l\'artisanat traditionnel avec une touche contemporaine. Le motif se compose de carrés structurés aux couleurs terreuses, évoquant la richesse et la stabilité. Au centre de chaque bloc, un élégant motif floral stylisé crée un point focal subtil mais captivant. La combinaison du marron chaud et du kaki tendance sur un fond crème lumineux en fait un choix parfait pour des tenues qui allient tradition et modernité. Idéal pour des tailleurs, des robes droites, ou des accessoires raffinés.','http://localhost:5000/uploads/1764098732871-IMG-20251125-WA0011.jpg','[\"http://localhost:5000/uploads/1764098732871-IMG-20251125-WA0011.jpg\"]',1,0,NULL,'2025-11-25 19:25:32'),(73,58,'Pagne Hollantex Vague de Vitalité - Pagne Zeste de Citron',2500.00,'\r\nÉnergique et audacieux ! Le pagne Vague de Vitalité attire immédiatement l\'œil avec son fond vert citron éclatant et ses rayures horizontales dynamiques. Le motif de spirales (ou de vagues) de couleur rouge bordeaux et blanche donne un mouvement ludique et moderne à l\'ensemble. Ce tissu est parfait pour des tenues estivales, des ensembles sport-chic ou pour les personnes qui n\'ont pas peur des couleurs franches. C\'est l\'incarnation de la joie de vivre et de la bonne humeur','http://localhost:5000/uploads/1764098852977-IMG-20251125-WA0012.jpg','[\"http://localhost:5000/uploads/1764098852977-IMG-20251125-WA0012.jpg\"]',1,0,NULL,'2025-11-25 19:27:32'),(74,58,'Pagne Hollantex Sagesse de la Forêt - Pagne à Message',2500.00,'\r\nCe pagne est bien plus qu\'un simple tissu, c\'est un message d\'espoir et de prospérité ! Le motif est richement illustré de feuilles et de lianes d\'arbre luxuriantes, évoquant la vitalité de la nature et la croissance. Le détail unique est la présence d\'un cartouche portant un proverbe. Les couleurs profondes (vert forêt et marron cuivré) confèrent une élégance intemporelle. C\'est le choix idéal pour une tenue de cérémonie, un cadeau significatif, ou une pièce d\'habillement qui raconte une histoire.','http://localhost:5000/uploads/1764098878372-IMG-20251125-WA0013.jpg','[\"http://localhost:5000/uploads/1764098878372-IMG-20251125-WA0013.jpg\"]',1,0,NULL,'2025-11-25 19:27:58'),(75,58,'Pagne Hollantex L\'Amour Entrelacé - Super Wax Cœur',2500.00,'\r\nDescription : Laissez-vous charmer par le motif vibrant de L\'Amour Entrelacé. Ce pagne Super Wax déploie une succession de cœurs majestueux et de rubans stylisés qui s\'entrecroisent à l\'infini, symbolisant l\'union, la force des liens et la passion. L\'équilibre chromatique entre le bordeaux profond et le vert olive énergique sur un fond jaune paille crée un contraste puissant et joyeux. C\'est le tissu idéal pour des événements joyeux, des robes de mariage ou de baptême, mais aussi pour exprimer votre personnalité au quotidien avec une touche de romantisme africain.','http://localhost:5000/uploads/1764098904551-IMG-20251125-WA0014.jpg','[\"http://localhost:5000/uploads/1764098904551-IMG-20251125-WA0014.jpg\"]',1,0,NULL,'2025-11-25 19:28:24'),(76,58,'Pagne Hollantex Océan Bleu - La Coquille Mystérieuse',2500.00,'Plongez dans les profondeurs avec ce superbe pagne Super Wax. Le motif représente de grandes coquilles ou des gouttes stylisées avec un effet de relief, qui rappellent la richesse des fonds marins. Le bleu turquoise éclatant ressort magnifiquement sur les lignes ondulées du fond crème et marron, évoquant le mouvement de l\'eau. Ce tissu est synonyme de sérénité et d\'évasion. Il est parfait pour des tenues estivales, des robes de plage sophistiquées ou pour apporter une touche de couleur et de fraîcheur à votre collection.','http://localhost:5000/uploads/1764102449070-IMG-20251125-WA0015.jpg','[\"http://localhost:5000/uploads/1764102449070-IMG-20251125-WA0015.jpg\"]',1,0,NULL,'2025-11-25 20:27:29'),(77,58,'Pagne Hollantex Aube Tropicale - L\'Étoile Montante',2500.00,'\r\n-Évoquant le spectacle grandiose du soleil se levant sur l\'horizon africain, ce pagne Guaranteed Block Print est rempli d\'intensité. Le motif récurrent est un soleil stylisé aux rayons puissants, encadré dans des blocs carrés. La couleur Orange Brûlé (ou terre de Sienne) est la star ici, apportant chaleur et richesse. Il est idéal pour des robes de cérémonie automnales, des boubous traditionnels ou toute confection nécessitant une couleur terreuse et profonde, pleine de caractère et de promesse.','http://localhost:5000/uploads/1764102478546-IMG-20251125-WA0016.jpg','[\"http://localhost:5000/uploads/1764102478546-IMG-20251125-WA0016.jpg\"]',1,0,NULL,'2025-11-25 20:27:58'),(78,58,'Pagne Hollantex Orchidées Majestueuses - Trio Violet/Vert',2500.00,'Découvrez l\'exubérance florale avec ce pagne Super Wax aux couleurs audacieuses. De grandes fleurs stylisées composées de trois pétales en forme de feuilles de vigne dominent le tissu, créant un motif dynamique. L\'association du violet royal et du vert citron électrique sur un fond gris très clair est ultra-moderne et incroyablement accrocheuse. Ce tissu est parfait pour des tenues de fête, des robes évasées qui magnifient le mouvement ou pour apporter une touche de fraîcheur et de sophistication à votre garde-robe.','http://localhost:5000/uploads/1764102509687-IMG-20251125-WA0017.jpg','[\"http://localhost:5000/uploads/1764102509687-IMG-20251125-WA0017.jpg\"]',1,0,NULL,'2025-11-25 20:28:29'),(79,58,'Pagne Hollantex Nuit Céleste - Pagne Étoiles et Damier',2500.00,'Laissez-vous transporter sous la Nuit Céleste ! Ce pagne associe deux motifs puissants : un damier structuré en noir et vert, et des emblèmes célestes (Lune et Étoiles) intégrés dans des carrés. La Lune et les Étoiles symbolisent l\'orientation, le rêve et la protection. Le contraste entre le bleu nuit profond et le vert lumineux rend ce tissu à la fois chic et mystérieux. Excellent choix pour des chemisiers, des robes élégantes ou des pièces qui jouent sur le contraste entre la structure et l\'imaginaire.','http://localhost:5000/uploads/1764102539089-IMG-20251125-WA0018.jpg','[\"http://localhost:5000/uploads/1764102539089-IMG-20251125-WA0018.jpg\"]',1,0,NULL,'2025-11-25 20:28:59'),(80,58,'Pagne Hollantex Soleil d\'Or - Super Block Géométrique',2500.00,'Ce pagne Super Block Print est un hommage à l\'énergie et à la symétrie. Le motif se compose de carrés imbriqués, dont le centre est occupé par une figure solaire éclatante de couleur jaune vif. L\'alternance entre le brun riche et le gris taupe crée un quadrillage sophistiqué, accentuant la luminosité du jaune. C\'est un tissu parfait pour des tenues structurées qui demandent à être remarquées : des jupes crayon, des vestes modernes ou des ensembles qui rayonnent de confiance.','http://localhost:5000/uploads/1764102571200-IMG-20251125-WA0019.jpg','[\"http://localhost:5000/uploads/1764102571200-IMG-20251125-WA0019.jpg\"]',1,0,NULL,'2025-11-25 20:29:31'),(81,58,'Pagne Hollantex Fierté du Paon - Rose et Vert Acide',2500.00,'Un festival de couleurs et de majesté ! Ce pagne Veritable Block Prints Super Wax met en scène de magnifiques Paons stylisés, l\'oiseau de la royauté et de l\'immortalité. Le motif est encadré par des guirlandes végétales, le tout sur un fond partagé entre le rose fuchsia audacieux et un vert acide vibrant. C\'est un tissu très haute couture, idéal pour les occasions spéciales, les robes de gala ou toutes les créations où vous souhaitez afficher l\'opulence, la joie et une palette de couleurs ultra-tendance.','http://localhost:5000/uploads/1764102603445-IMG-20251125-WA0020.jpg','[\"http://localhost:5000/uploads/1764102603445-IMG-20251125-WA0020.jpg\"]',1,0,NULL,'2025-11-25 20:30:03'),(82,58,'Pagne Hollantex L\'Éclosion de l\'Œuf - Le Poussin Célèbre',2500.00,'Ce pagne charmant combine l\'ordre du damier avec la douceur d\'un motif animalier. Le thème du poussin et de l\'œuf symbolise la naissance, le nouveau départ et l\'espoir. Le damier géant en Marron Chocolat et Crème confère une structure classique à laquelle les petits motifs de poussins et d\'œufs apportent une touche ludique. C\'est un choix intemporel et chaleureux, idéal pour des tenues de jour, des robes légères ou des accessoires qui célèbrent la vie et l\'innocence.','http://localhost:5000/uploads/1764102639394-IMG-20251125-WA0021.jpg','[\"http://localhost:5000/uploads/1764102639394-IMG-20251125-WA0021.jpg\"]',1,0,NULL,'2025-11-25 20:30:39'),(87,58,'Pagne Hollantex Architecture Moderne - L\'Énergie Urbaine',2500.00,'Ce pagne Guaranteed Block Prints est résolument moderne et abstrait, évoquant des paysages urbains, des routes ou des gratte-ciels enchevêtrés. Les lignes graphiques et les blocs de couleurs créent une sensation de mouvement et de complexité dynamique. Le mariage du Vert Olive et de l\'Orange Rouille sur un fond noir apporte un contraste brut et sophistiqué. Ce tissu est parfait pour des créations avant-gardistes, des chemises pour hommes ou des pièces qui célèbrent le design contemporain et la puissance de la géométrie.','http://localhost:5000/uploads/1764103163414-IMG-20251125-WA0022.jpg','[\"http://localhost:5000/uploads/1764103163414-IMG-20251125-WA0022.jpg\"]',1,0,NULL,'2025-11-25 20:39:23'),(88,58,'Pagne Hollantex Panache Royal - Le Fouet du Chef',2500.00,'Ce pagne Super Wax est un symbole de pouvoir et de respect. Le motif principal, souvent appelé le \"Fouet du Chef\" (ou Panache Royal), représente un attribut d\'autorité et de sagesse dans de nombreuses cultures ouest-africaines. Le Jaune Vif et l\'ocre soulignent la forme dynamique du motif sur un fond de Bleu Marine profond, créant un contraste classique et élégant. Ce tissu est parfait pour des tenues de cérémonie, des boubous dignes ou toute confection destinée à exprimer la noblesse et l\'influence.','http://localhost:5000/uploads/1764103213266-IMG-20251125-WA0023.jpg','[\"http://localhost:5000/uploads/1764103213266-IMG-20251125-WA0023.jpg\"]',1,0,NULL,'2025-11-25 20:40:13'),(89,58,'Pagne Hollantex Générosité de la Nature - La Gousse d\'Or',2500.00,'Une célébration de la fertilité et de la récolte. Ce pagne Wax présente de grandes formes organiques évoquant des gousses ou des feuilles remplies de graines. Les motifs intérieurs, complexes et vagues, donnent une profondeur et une richesse visuelle. La palette de couleurs est très terreuse : le Marron et le Brun Cuivré s\'entremêlent au Jaune Brillant, rappelant la richesse de la terre. C\'est le tissu parfait pour une tenue authentique, une robe qui met en valeur les formes naturelles ou toute pièce exprimant la générosité et l\'abondance.','http://localhost:5000/uploads/1764103246882-IMG-20251125-WA0024.jpg','[\"http://localhost:5000/uploads/1764103246882-IMG-20251125-WA0024.jpg\"]',1,0,NULL,'2025-11-25 20:40:46'),(90,58,'Pagne Hollantex Mouvement Infini - La Spirale Protectrice',2500.00,'Le motif de spirales est l\'élément central de ce pagne Wax, suggérant le mouvement, le renouvellement ou la coquille de l\'escargot (symbole de persévérance et de protection). Les demi-cercles s\'imbriquent et s\'entourent pour former un motif abstrait et hypnotisant. La palette est riche et terreuse, dominée par le Brun Chocolat et le Jaune Ocre, ce qui en fait un classique élégant. C\'est un choix polyvalent, sophistiqué et intemporel pour des robes de jour, des accessoires ou des décorations intérieures.','http://localhost:5000/uploads/1764103280974-IMG-20251125-WA0025.jpg','[\"http://localhost:5000/uploads/1764103280974-IMG-20251125-WA0025.jpg\"]',1,0,NULL,'2025-11-25 20:41:20'),(91,58,'Pagne Hollantex Festin Tropical - Les Graines de la Vie',2500.00,'Ce pagne est une explosion joyeuse de motifs alimentaires, représentant des fruits, haricots et grains stylisés. Souvent appelé le motif des \"Fruits de la Fortune\" ou des \"Graines de la Vie\", il symbolise la nourriture, la chance et la prospérité. Le contraste du Rouge Tomate et du Jaune Vif sur le fond noir profond rend chaque motif vibrant et appétissant. C\'est le tissu idéal pour des tenues pleines de gaieté, parfaites pour le marché, les réunions de famille ou pour ajouter une énergie positive à votre collection.','http://localhost:5000/uploads/1764103313056-IMG-20251125-WA0026.jpg','[\"http://localhost:5000/uploads/1764103313056-IMG-20251125-WA0026.jpg\"]',1,0,NULL,'2025-11-25 20:41:53'),(92,58,'Pagne Hollantex Perles d\'Ondulation - Géométrie Végétale',2500.00,'Un motif intemporel d\'une élégance rare. Ce Veritable Block Prints Super Wax présente un réseau de formes en gouttelettes ou en écailles qui se connectent pour former un motif continu et hypnotique. Le fond gris pâle met en valeur les contours bleu marine et les petits détails bordeaux et or. Ce design offre une texture visuelle riche et une sophistication discrète. Idéal pour des tenues chics, des tailleurs ou des accessoires qui demandent de la finesse et de la profondeur.','http://localhost:5000/uploads/1764103337744-IMG-20251125-WA0027.jpg','[\"http://localhost:5000/uploads/1764103337744-IMG-20251125-WA0027.jpg\"]',1,0,NULL,'2025-11-25 20:42:17'),(93,58,'Pagne Hollantex Soleil Africain - Damier Ambré',2500.00,'Ce pagne Super Hollantex Wax est une véritable bouffée de chaleur. Il combine une structure de damier avec un motif central de Soleil Radieux dans chaque carré. L\'association de l\'Orange Vif et du Jaune sur le fond noir et gris crée un contraste énergique et joyeux. C\'est l\'incarnation de la lumière, de la vitalité et de l\'optimisme. Idéal pour des tenues estivales, des robes qui rayonnent ou pour toute personne qui veut ajouter une touche de soleil à sa garde-robe.','http://localhost:5000/uploads/1764103362630-IMG-20251125-WA0028.jpg','[\"http://localhost:5000/uploads/1764103362630-IMG-20251125-WA0028.jpg\"]',1,0,NULL,'2025-11-25 20:42:42'),(94,58,'Pagne Hollantex Flux du Désert - Les Vagues de Sable',2500.00,'Ce design hypnotique présente de fines rayures qui ondulent pour créer un effet de perspective et de profondeur, rappelant les dunes de sable sculptées par le vent ou un mouvement d\'eau. La palette est élégante et neutre, dominée par le Brun Chocolat et les nuances de Jaune Ocre. C\'est un choix très sophistiqué, excellent pour des tenues professionnelles, des coupes épurées ou pour donner une dimension chic et texturée à un ensemble.','http://localhost:5000/uploads/1764103385266-IMG-20251125-WA0029.jpg','[\"http://localhost:5000/uploads/1764103385266-IMG-20251125-WA0029.jpg\"]',1,0,NULL,'2025-11-25 20:43:05'),(95,58,'Pagne Hollantex Flamme Tropicale - Super Wax Fuchsia',2500.00,'Incroyablement vibrant, ce pagne Super Guaranteed Block Wax met en scène de gigantesques feuilles stylisées aux contours noirs audacieux. Le Fuchsia électrique s\'impose, créant un contraste saisissant avec le fond beige et les motifs intérieurs complexes. Ce design est un véritable statement piece, parfait pour les robes de soirée, les ensembles qui attirent la lumière et toute confection qui célèbre la féminité audacieuse et le dynamisme tropical.','http://localhost:5000/uploads/1764103444125-IMG-20251125-WA0030.jpg','[\"http://localhost:5000/uploads/1764103444125-IMG-20251125-WA0030.jpg\"]',1,0,NULL,'2025-11-25 20:44:04'),(96,58,'Pagne Hollantex Ondes de Couleurs - La Danse du Nuage',2500.00,'Un motif abstrait et organique, comme des nuages coulants ou des organismes marins. Ce pagne utilise un contraste de couleurs primaires intenses : le Jaune Soleil et le Rouge Vif dansent sur un fond Bleu Nuit. L\'effet est à la fois électrique et joyeux. Ce tissu est fantastique pour des pièces modernes et déstructurées, exprimant la liberté, l\'énergie et la joie de vivre avec une touche d\'art abstrait.','http://localhost:5000/uploads/1764103470812-IMG-20251125-WA0031.jpg','[\"http://localhost:5000/uploads/1764103470812-IMG-20251125-WA0031.jpg\"]',1,0,NULL,'2025-11-25 20:44:30'),(97,58,'Pagne Hollantex Le Trésor de l\'Héritage - Pagne Clés',2500.00,'Ce tissu exceptionnel est centré sur le motif emblématique des Clés d\'Or, qui symbolisent la richesse, l\'accès, la connaissance et l\'opportunité. Les grandes clés élégantes sont magnifiquement mises en valeur par le fond bleu-noir au motif géométrique en damier. L\'éclat du Jaune Or ajoute une dimension luxueuse. C\'est le pagne de choix pour les célébrations importantes, les cadeaux de prestige ou pour toute personne qui souhaite exprimer son succès et son potentiel.','http://localhost:5000/uploads/1764103500085-IMG-20251125-WA0032.jpg','[\"http://localhost:5000/uploads/1764103500085-IMG-20251125-WA0032.jpg\"]',1,0,NULL,'2025-11-25 20:45:00'),(98,58,'Pagne Hollantex La Vague Ardente - Super Wax Zigzag',2500.00,'Laissez-vous emporter par le dynamisme de ce motif en zigzag ou en vagues puissantes. Les couleurs chaudes — Rouge Ardent, Orange et Jaune Soleil — évoquent le feu, le désert et la passion, créant une énergie visuelle intense. La répétition du motif est parfaite pour des drapés fluides ou des ensembles qui nécessitent un mouvement rythmique. C\'est un tissu audacieux qui promet de faire tourner les têtes.','http://localhost:5000/uploads/1764103538193-IMG-20251125-WA0033.jpg','[\"http://localhost:5000/uploads/1764103538193-IMG-20251125-WA0033.jpg\"]',1,0,NULL,'2025-11-25 20:45:38'),(99,58,'Pagne Hollantex Récolte Émeraude - Les Graines du Succès',2500.00,'Ce pagne célèbre la vie et la fertilité avec un grand motif de rondelles végétales (fruits, graines ou coupes de racines) sur un fond Vert Forêt intense. Le Orange Rouille et le Jaune Ocre apportent une chaleur terreuse, créant une atmosphère de prospérité. C\'est un tissu parfait pour les personnes en quête d\'un style enraciné, mais élégant. Idéal pour les événements en extérieur, les tuniques ou les pièces inspirées de la nature.','http://localhost:5000/uploads/1764103601770-IMG-20251125-WA0034.jpg','[\"http://localhost:5000/uploads/1764103601770-IMG-20251125-WA0034.jpg\"]',1,0,NULL,'2025-11-25 20:46:41'),(100,58,'Pagne Hollantex Hypnose Bleue - Cercles Rétro',2500.00,'Un effet optique saisissant ! Ce pagne est un classique revisité, souvent appelé le motif de \"l\'œil\" ou du \"disque\". De grands cercles concentriques sont créés par une multitude de petits points, donnant une impression de profondeur et de mouvement rotatif. Le contraste entre le Bleu Roi vibrant et le Noir & Blanc est puissant et très graphique. C\'est le tissu parfait pour des pièces modernes, des jupes midi pleines ou des tenues qui cherchent à faire une déclaration visuelle forte.','http://localhost:5000/uploads/1764103632248-IMG-20251125-WA0035.jpg','[\"http://localhost:5000/uploads/1764103632248-IMG-20251125-WA0035.jpg\"]',1,0,NULL,'2025-11-25 20:47:12'),(101,58,'Pagne Hollantex - Le Jardin Émeraude',2500.00,'','http://localhost:5000/uploads/1764103792441-IMG-20251125-WA0036.jpg','[\"http://localhost:5000/uploads/1764103792441-IMG-20251125-WA0036.jpg\"]',1,0,NULL,'2025-11-25 20:49:52'),(102,58,'Pagne Hollantex Empreinte du Safari - Super Wax Animalier',2500.00,'Ce tissu Super Hollantex Wax est une explosion de texture et de couleur, évoquant le dynamisme d\'une peau de léopard ou d\'une fourrure animale. Le motif dense et abstrait est construit à partir de petits blocs de couleurs qui se superposent, donnant une impression de profondeur et de mouvement constant. L\'Orange Brûlé dominant est tempéré par des touches de Bleu Nuit et de Rouge, créant un look tribal chic et puissant. C\'est le choix idéal pour des tenues audacieuses, des accessoires de mode ou des pièces qui célèbrent la force de la nature.','http://localhost:5000/uploads/1764103821141-IMG-20251125-WA0037.jpg','[\"http://localhost:5000/uploads/1764103821141-IMG-20251125-WA0037.jpg\"]',1,0,NULL,'2025-11-25 20:50:21'),(103,58,'Pagne Hollantex Tissage du Griot - Géométrie Ocre',2500.00,'D\'une élégance minimaliste, ce pagne Veritable Block Prints est basé sur un motif de losanges et de diamants qui s\'entrecroisent. La répétition crée un effet d\'étoile ou de kaléidoscope sophistiqué. La palette est douce mais affirmée : le Gris Pâle sert de toile de fond au motif en Jaune Ocre et Brun, offrant un look polyvalent et chic. Ce tissu est parfait pour des tenues professionnelles, des vestes structurées ou pour toute confection nécessitant un motif discret mais captivant.','http://localhost:5000/uploads/1764103859165-IMG-20251125-WA0038.jpg','[\"http://localhost:5000/uploads/1764103859165-IMG-20251125-WA0038.jpg\"]',1,0,NULL,'2025-11-25 20:50:59'),(104,58,'Pagne Hollantex Harmonie Aquatique - Fleurs de Lotus',2500.00,'Ce motif est un véritable jardin flottant ! De grandes fleurs stylisées de type Mandala (ou Fleurs de Lotus) dominent le tissu, symbolisant la pureté, la sagesse et l\'harmonie. Le choix chromatique est rafraîchissant et lumineux : le Violet et le Lilas s\'équilibrent sur un fond Turquoise et Blanc aux motifs géométriques délicats. Ce pagne est un excellent choix pour les événements printaniers/estivaux, les robes fluides et pour apporter une touche de sérénité et d\'originalité à votre style.','http://localhost:5000/uploads/1764103891523-IMG-20251125-WA0039.jpg','[\"http://localhost:5000/uploads/1764103891523-IMG-20251125-WA0039.jpg\"]',1,0,NULL,'2025-11-25 20:51:31'),(105,58,'Pagne Hollantex La Tresse d\'Or',2500.00,'Adoptez l\'élégance classique avec \"La Tresse d\'Or\". Ce motif emblématique, souvent appelé la \"Queue de Bœuf\" (symbole de richesse et de statut), combine un fond bleu marine texturé avec de somptueuses tresses jaunes moutarde. Ce tissu haut de gamme Hollantex offre un contraste parfait et une symbolique forte. Il est le choix idéal pour un ensemble de mariage, une tenue de fête traditionnelle ou une création contemporaine pleine de prestige.','http://localhost:5000/uploads/1764103919558-IMG-20251125-WA0040.jpg','[\"http://localhost:5000/uploads/1764103919558-IMG-20251125-WA0040.jpg\"]',1,0,NULL,'2025-11-25 20:51:59'),(106,58,'Pagne Hollantex Oasis Tropicale - Palmiers et Cercles',2500.00,'L\'évasion garantie ! Ce pagne Guaranteed Block Wax vous transporte sous les tropiques avec ses motifs de palmiers majestueux et de grands cercles concentriques qui évoquent des disques solaires ou des calebasses. Le mélange de Vert Olive Profond et de Rouge Brique crée une ambiance chaleureuse et naturelle, tandis que les motifs en damier ajoutent de la texture. C\'est le tissu parfait pour des tenues décontractées, des robes de plage sophistiquées ou pour la décoration intérieure','http://localhost:5000/uploads/1764103972784-IMG-20251125-WA0041.jpg','[\"http://localhost:5000/uploads/1764103972784-IMG-20251125-WA0041.jpg\"]',1,0,NULL,'2025-11-25 20:52:52'),(107,58,'Pagne Hollantex - Fleur de Vigne et Cacao',2500.00,'Découvrez la richesse des couleurs tropicales avec \"Fleur de Vigne et Cacao\". Ce design audacieux présente de grandes fleurs majestueuses dans des tons profonds de bordeaux et de marron cacao, mises en lumière par un jaune or éclatant sur un fond crème moucheté. Un pagne idéal pour les tenues de mi-saison ou d\'hiver, apportant une chaleur luxueuse à toute garde-robe. Parfait pour une robe fourreau ou une jupe droite élégante.','http://localhost:5000/uploads/1764104053665-IMG-20251125-WA0043.jpg','[\"http://localhost:5000/uploads/1764104053665-IMG-20251125-WA0043.jpg\"]',1,0,NULL,'2025-11-25 20:54:13'),(108,58,'Pagne Hollantex Chemin du Serpent - Le Gardien',2500.00,'Un design puissant souvent appelé \"Chemin du Serpent\" ou \"Garde Royale\". Le motif central met en scène un serpent ondulant (symbole de sagesse, de guérison ou de protection) au milieu de bandes graphiques et de motifs géométriques en damier. Le Bleu Marine est richement contrasté par le Jaune Moutarde et l\'Orange Rouille. C\'est un pagne chargé de signification, idéal pour des tenues qui expriment le leadership, la force et le respect des traditions.','http://localhost:5000/uploads/1764104084024-IMG-20251125-WA0044.jpg','[\"http://localhost:5000/uploads/1764104084024-IMG-20251125-WA0044.jpg\"]',1,0,NULL,'2025-11-25 20:54:44'),(109,58,'Pagne Hollantex - Le Masque Ancestral',2500.00,'Célébrez l\'héritage africain avec \"Le Masque Ancestral\". Ce motif hypnotique présente des formes symétriques et complexes qui rappellent les masques traditionnels, symboles de sagesse et de protection. Le fond discret gris-bleu met en valeur l\'éclat des détails en ocre et blanc. C\'est un choix majestueux pour des robes longues, des jupes midi élégantes ou des vestes structurées, portant en elles une histoire de fierté et de tradition.','http://localhost:5000/uploads/1764104121688-IMG-20251125-WA0045.jpg','[\"http://localhost:5000/uploads/1764104121688-IMG-20251125-WA0045.jpg\"]',1,0,NULL,'2025-11-25 20:55:21'),(110,58,'Pagne Hollantex - L\'Envol des Tisserins',2500.00,'Laissez votre créativité prendre son envol avec le pagne \"L\'Envol des Tisserins\". Ce tissu joyeux met en scène des oiseaux dynamiques et un feuillage luxuriant, dans un contraste saisissant entre le fond bleu nuit et les motifs lumineux jaune-néon et noir. Ce motif symbolise souvent la liberté et l\'opportunité. Parfait pour des tenues décontractées-chic, des chemisiers légers ou des robes d\'été pleines de pep\'s. Un motif frais et intemporel !','http://localhost:5000/uploads/1764104146693-IMG-20251125-WA0046.jpg','[\"http://localhost:5000/uploads/1764104146693-IMG-20251125-WA0046.jpg\"]',1,0,NULL,'2025-11-25 20:55:46'),(111,58,'Pagne Hollantex Vigne Exubérante - Vert Printemps',2500.00,'Un tissu délicat et frais, inspiré des jardins luxuriants. Le motif est composé de grandes feuilles stylisées et de fleurs en clochettes, créant une danse végétale élégante sur un fond écru. Le Vert Printemps est riche et vibrant, souligné par les fines spirales blanches. Ce pagne est un choix parfait pour des tenues qui célèbrent la nature, la croissance et le renouveau, idéal pour des robes longues ou des ensembles d\'été pleins de légèreté.','http://localhost:5000/uploads/1764104177072-IMG-20251125-WA0047.jpg','[\"http://localhost:5000/uploads/1764104177072-IMG-20251125-WA0047.jpg\"]',1,0,NULL,'2025-11-25 20:56:17'),(112,58,'Pagne Hollantex - Volutes de Bronze',2500.00,'Un design chic et moderne. Le pagne \"Volutes de Bronze\" se démarque par la fluidité de son motif \"Queue de Bœuf\" rehaussé de lignes de bronze et de marron profond. La finesse de la micro-grille sur le fond crée un effet de texture visuel très recherché. Ce tissu offre une grande polyvalence pour la couture, permettant de créer aussi bien des robes ajustées que des tenues traditionnelles modernisées.','http://localhost:5000/uploads/1764104201180-IMG-20251125-WA0048.jpg','[\"http://localhost:5000/uploads/1764104201180-IMG-20251125-WA0048.jpg\"]',1,0,NULL,'2025-11-25 20:56:41'),(113,58,'Pagne Hollantex - Crocodile de Feu',2500.00,'Plongez dans les teintes chaudes et profondes du pagne \"Crocodile de Feu\". Ce tissu luxueux reprend le motif populaire de la houppette mais dans une palette de couleurs terreuses : un fond noir texturé est éclairé par des touches d\'ambre et des motifs bordeaux profond. Ce Wax est parfait pour des tenues de soirée sophistiquées, des tailleurs chics ou des accessoires qui expriment à la fois force et raffinement.','http://localhost:5000/uploads/1764104232304-IMG-20251125-WA0049.jpg','[\"http://localhost:5000/uploads/1764104232304-IMG-20251125-WA0049.jpg\"]',1,0,NULL,'2025-11-25 20:57:12'),(114,58,'Pagne Hollantex Ailes de la Fortune - Bloc Volant',2500.00,'Ce pagne porte un motif symbolique très populaire, souvent appelé \"Ailes\", \"Chèque\" ou \"Billet d\'Avion\". Il représente l\'envol, la réussite, le voyage, et la prospérité. Les grandes ailes stylisées encadrent des petits blocs de paysage (ressemblant à des billets ou des documents) et des cercles avec le chiffre \"10\". L\'énergie est transmise par l\'éclat de l\'Orange Vif et du Jaune sur le fond Bleu Marine. C\'est un tissu incontournable pour les célébrations de succès, les cadeaux d\'affaires et les tenues qui proclament le dynamisme et l\'ambition','http://localhost:5000/uploads/1764104252423-IMG-20251125-WA0050.jpg','[\"http://localhost:5000/uploads/1764104252423-IMG-20251125-WA0050.jpg\"]',1,0,NULL,'2025-11-25 20:57:32'),(115,58,'Pagne Hollantex - La Mère Poule',2500.00,'Le classique incontournable ! Le pagne \"La Mère Poule\" est un motif très populaire symbolisant la fertilité, la protection et la famille. Les poules jaune néon et les poussins rose fushia éclatent sur un fond vert olive. C\'est un tissu plein de gaieté et de sens, souvent offert en cadeau. Sa palette de couleurs tendance est parfaite pour une tenue pleine de caractère qui célèbre la vie et l\'abondance.','http://localhost:5000/uploads/1764104275762-IMG-20251125-WA0051.jpg','[\"http://localhost:5000/uploads/1764104275762-IMG-20251125-WA0051.jpg\"]',1,0,NULL,'2025-11-25 20:57:55'),(116,58,'Pagne Hollantex L\'Oeil Hypnotique',2500.00,'Laissez-vous captiver par le motif \"L\'Oeil Hypnotique\". Ce pagne Wax Hollantex est une explosion d\'énergie avec son fond vert citron et jaune vibrant, rehaussé par des cercles concentriques audacieux en violet et jaune. Idéal pour celles qui n\'ont pas peur d\'affirmer leur style, ce tissu est parfait pour créer des tenues de cérémonie, des robes structurées ou des accessoires qui ne passeront jamais inaperçus. Qualité garantie pour un éclat durable.','http://localhost:5000/uploads/1764104300279-IMG-20251125-WA0052.jpg','[\"http://localhost:5000/uploads/1764104300279-IMG-20251125-WA0052.jpg\"]',1,0,NULL,'2025-11-25 20:58:20'),(117,58,'Pagne Jungle Mystique - Fleur de Corail',2500.00,'Ce pagne est une immersion dans une jungle sous-marine ou mystique. Le fond Bleu Roi intense est recouvert d\'une multitude de petits motifs et de formes botaniques complexes. Les éléments principaux, comme de grandes feuilles stylisées ou des fleurs de corail, ressortent en Vert Olive et Rouge Corail, créant une texture visuelle riche et captivante. Ce design est parfait pour les robes qui bougent, les ensembles artistiques et pour toute personne qui adore l\'originalité et la profondeur des motifs détaillés.','http://localhost:5000/uploads/1764104326445-IMG-20251125-WA0053.jpg','[\"http://localhost:5000/uploads/1764104326445-IMG-20251125-WA0053.jpg\"]',1,0,2750.00,'2025-11-25 20:58:46');
