INSERT INTO `contenus_legaux` VALUES (1,'a-propos','<h2>Notre Histoire</h2><p>SAFIYA BOUTIQUE est née d\'une idée simple : rendre l\'élégance accessible à toutes les <span style=\"color: rgb(61, 40, 23);\">femmes.</span></p><p>Fraîchement lancée, notre boutique est le résultat d\'une passion pour la mode féminine, les belles pièces et le souci du détail. Dès le début, nous avons voulu créer un espace où chaque femme peut trouver des articles modernes, tendance et de qualité, sans compromis sur son budget.</p><p>Notre aventure a commencé avec la volonté d\'apporter un style unique mêlant modernité, authenticité et raffinement. Aujourd\'hui, même si SAFIYA BOUTIQUE est jeune, notre ambition est grande : devenir une référence en matière d\'élégance féminine.</p><h2>Notre Mission</h2><p>Nous nous engageons à offrir une expérience shopping exceptionnelle :</p><ul><li>Une sélection rigoureuse d\'articles féminins tendance</li><li>Des produits qui allient modernité, élégance et durabilité</li><li>Un service client chaleureux, disponible et à l\'écoute</li><li>Des prix accessibles pour que chaque femme puisse se faire plaisir</li><li>Une livraison rapide, fiable et sécurisée</li></ul><p>Notre différence ? Un esprit familial, une passion authentique pour la mode, et l\'envie sincère d\'apporter des articles qui valorisent la femme, quel que soit son style.</p><h2>Nos Produits</h2><p>Chez SAFIYA BOUTIQUE, nous proposons une sélection soignée d\'articles féminins :</p><ul><li><strong>Sacs</strong> : modèles modernes, élégants et intemporels</li><li><strong>Montres</strong> : collections raffinées pour sublimer chaque tenue</li><li><strong>Chaussures</strong> : confort, style et finition de qualité</li><li><strong>Accessoires</strong> : pièces uniques pour apporter la touche finale à votre look</li></ul><p>Chaque produit est choisi avec soin afin de vous garantir le meilleur rapport qualité-prix.</p><h2>Notre Engagement</h2><ul><li>✓</li><li><strong>Qualité garantie</strong> : des articles soigneusement sélectionnés</li><li>✓</li><li><strong>Prix transparents</strong> : pas de frais cachés, juste le bon prix</li><li>✓</li><li><strong>Livraison sécurisée</strong> : vos commandes sont préparées avec soin</li><li>✓</li><li><strong>Support client réactif</strong> : une équipe à votre écoute pour vous accompagner</li></ul><h3>Contactez-nous</h3><p>Une question ? N\'hésitez pas à nous contacter, nous serons ravis de vous aider.</p><p><a href=\"/panier\" rel=\"noopener noreferrer\" target=\"_blank\"> Voir nos produits </a></p>','2025-11-28 19:09:51'),(2,'mentions-legales','<h2>1. Éditeur du Site</h2><p><strong>Raison sociale :</strong> SAFIYA BOUTIQUE</p><p><strong>Statut juridique :</strong> Auto-entrepreneur</p><p><strong>RCCM :</strong> En cours d\'immatriculation</p><p><strong>IFU :</strong> Non encore attribué</p><p><strong>Siège social :</strong> Cocody Angré 8ᵉ tranche, Abidjan, Côte d\'Ivoire</p><p><strong>Éditeur et responsable de publication :</strong> Kamate Mansonna</p><p><strong>Email :</strong> contact-safiyaboutique@gmail.com</p><p><strong>Téléphone :</strong> +225 0505616042</p><h2>2. Hébergement du site</h2><p><strong>Hébergeur :</strong> [À compléter]</p><h2>3. Propriété Intellectuelle</h2><p>Tous les contenus présents sur ce site (textes, images, logos, vidéos, design, produits) sont protégés par la législation ivoirienne sur la propriété intellectuelle.</p><p>Toute reproduction, diffusion ou exploitation, totale ou partielle, est interdite sans autorisation écrite de SAFIYA BOUTIQUE.</p><p>Les marques, logos et signes distinctifs sont la propriété exclusive de SAFIYA BOUTIQUE.</p><h2>4. Collecte et Traitement des Données</h2><p>Les informations personnelles collectées sont utilisées uniquement pour :</p><ul><li>La gestion des commandes et la livraison</li><li>La facturation et le suivi client</li><li>L\'amélioration de l\'expérience utilisateur</li></ul><p>Conformément à la loi ivoirienne, vos données sont protégées et confidentielles.</p><p>Pour plus d\'informations, consultez notre <a href=\"/politique-de-confidentialite\" rel=\"noopener noreferrer\" target=\"_blank\">Politique de Confidentialité</a>.</p><h2>5. Cookies</h2><p>Le site peut utiliser des cookies pour :</p><ul><li>Améliorer la navigation</li><li>Personnaliser les services proposés</li></ul><p>Vous pouvez configurer votre navigateur pour refuser les cookies, mais certaines fonctionnalités du site pourraient être limitées.</p><h2>6. Limitation de Responsabilité</h2><p>SAFIYA BOUTIQUE s\'efforce de fournir des informations exactes et à jour sur ce site.</p><p>Cependant, l\'éditeur ne peut garantir l\'exactitude totale des informations.</p><p>L\'utilisation du site se fait sous la seule responsabilité de l\'utilisateur.</p><p>SAFIYA BOUTIQUE décline toute responsabilité pour tout dommage direct ou indirect lié à l\'usage du site ou à l\'interruption du service.</p><h2>7. Droit Applicable</h2><p>Ces mentions légales sont régies par la loi ivoirienne.</p><p>Tout litige relatif à l\'utilisation du site relève de la compétence exclusive des tribunaux d\'Abidjan, Côte d\'Ivoire.</p>','2025-11-27 17:43:07'),(3,'politique-confidentialite','<h1><br></h1><p>Protection et traitement de vos données personnelles</p><p><strong>Dernière mise à jour :</strong>&nbsp;26 novembre 2025</p><h2>1. RESPONSABLE DU TRAITEMENT</h2><p><strong>Raison sociale :</strong>&nbsp;SAFIYA BOUTIQUE</p><p><strong>Statut juridique :</strong>&nbsp;Auto-entrepreneur (Côte d\'Ivoire)</p><p><strong>Siège social :</strong>&nbsp;Cocody Angré 8ᵉ tranche, Abidjan, Côte d\'Ivoire</p><p><strong>Éditeur et responsable du traitement :</strong>&nbsp;Kamate Mansonna</p><p><strong>Email :</strong>&nbsp;contact-safiyaboutique@gmail.com</p><p><strong>Téléphone :</strong>&nbsp;+225 0505616042</p><h2>2. DONNÉES COLLECTÉES</h2><h3>2.1. Données collectées directement via le formulaire de livraison</h3><ul><li>Nom et prénom</li><li>Numéro de téléphone</li><li>Commune / adresse de livraison</li><li>Détails de la commande</li></ul><h3>2.2. Données collectées automatiquement</h3><ul><li><strong>Cookies essentiels :</strong>&nbsp;nécessaires au fonctionnement du site et à la navigation</li><li><strong>Données techniques limitées :</strong>&nbsp;type de navigateur, adresse IP (pour sécuriser le site)</li></ul><p><strong>Aucune donnée bancaire n\'est collectée sur le site.</strong>&nbsp;Les paiements se font directement via Wave ou par redirection WhatsApp pour finaliser la commande.</p><h2>3. FINALITÉS DU TRAITEMENT</h2><p>Vos données personnelles sont utilisées uniquement pour :</p><ul><li>Traiter et organiser votre commande</li><li>Livrer vos produits à l\'adresse indiquée</li><li>Communiquer avec vous concernant votre commande</li><li>Prévenir la fraude et sécuriser les transactions</li></ul><p><strong>Aucune donnée n\'est utilisée à des fins marketing ou commerciale sans votre consentement explicite.</strong></p><h2>4. DURÉE DE CONSERVATION</h2><ul><li><strong>Données de commande et de contact :</strong>&nbsp;3 ans après la dernière transaction ou interaction</li><li><strong>Cookies :</strong>&nbsp;maximum 13 mois</li></ul><p>Passé ces durées, les données sont supprimées ou anonymisées de manière sécurisée.</p><h2>5. DESTINATAIRES DES DONNÉES</h2><p>Vos données peuvent être communiquées uniquement à :</p><ul><li>Le personnel autorisé de SAFIYA BOUTIQUE</li><li>Les prestataires impliqués dans la livraison ou le paiement (Wave, transporteur)</li><li>Les autorités compétentes si requis par la loi</li></ul><h2>6. SÉCURITÉ DES DONNÉES</h2><p>SAFIYA BOUTIQUE met en œuvre des mesures pour protéger vos données :</p><ul><li>Accès sécurisé aux informations</li><li>Sauvegardes régulières</li><li>Surveillance et contrôle de l\'accès aux données</li></ul><h2>7. VOS DROITS</h2><p>Vous disposez des droits suivants :</p><ul><li>Accéder à vos données et les rectifier</li><li>Demander leur suppression</li><li>Limiter leur traitement</li><li>Vous opposer au traitement</li></ul><p>Pour exercer vos droits :&nbsp;<strong>contact-safiyaboutique@gmail.com</strong></p><h2>8. COOKIES</h2><p>Le site utilise uniquement des cookies essentiels pour assurer le fonctionnement correct du formulaire et de la navigation.</p><p>Vous pouvez les refuser, mais certaines fonctionnalités du site pourraient ne plus fonctionner correctement.</p><h2>9. MODIFICATIONS DE LA POLITIQUE</h2><p>SAFIYA BOUTIQUE se réserve le droit de modifier cette politique à tout moment.</p><p>La dernière mise à jour est indiquée en haut de la page.</p><p>Nous vous recommandons de consulter régulièrement cette page pour rester informé.</p>','2025-11-27 17:43:42');
